import React, { useState } from "react";
import "./App.css";
import Panel from "./Panel";
function App() {
  const [foremostIndex, setForemostIndex] = useState(1);
  const updateIndex = (id) => {
    setForemostIndex(foremostIndex + 1);
    document.getElementById(`panel-${id}`).style.zIndex = foremostIndex;
  };
  return (
    <div className="App">
      <Panel updateIndex={updateIndex} id={1}>
        <textarea></textarea>
      </Panel>
      <Panel updateIndex={updateIndex} id={2}>
        <img
          src="https://external-preview.redd.it/naDyEuJPmML8_ByqaHs96fPo2okxmFmrsO5heEq6-FY.jpg?auto=webp&s=42b843af2ce44bec7bd3f2a6bb10b0ca67aa8bec"
          alt="asdfasdfa"
          srcset=""
        />
      </Panel>
      <Panel updateIndex={updateIndex} id={3}>
        <iframe
          width="560"
          height="315"
          src="https://www.youtube.com/embed/_BfibugPqPo"
          title="YouTube video player"
          frameborder="0"
          allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
          allowfullscreen
        ></iframe>
      </Panel>
      <Panel updateIndex={updateIndex} id={4}></Panel>
    </div>
  );
}

export default App;
